import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="home">
      <nav className="topnav">
        <div className="logo">üè° Green Valley Community</div>
        <div className="nav-buttons">
          <Link to="/login">Login</Link>
          <Link to="/register">Sign Up</Link>
        </div>
      </nav>
      
      <header className="header">
        <h1>Welcome to Green Valley Society</h1>
        <p>Your smart community</p>
      </header>

      <section className="contact">
        <h2>Contact Us</h2>
        <p>üìû Secretary: +91 9876543210</p>
        <p>üìß Email: greenvalley@community.com</p>
      </section>

      <footer>
        <p>¬© 2025 Green Valley Society</p>
      </footer>
    </div>
  );
}

export default Home;
